  `timeLastZero` bigint(20) unsigned NOT NULL COMMENT '上次计数器清零的时间(秒级时间戳)',
  `timeLastCall` bigint(20) unsigned NOT NULL COMMENT '最近一次调用接口时间(秒级时间戳)',
  PRIMARY KEY (`module`,`action`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='接口的频次控制表';
